import {data} from "../api/data";
import Note from "./Note";

const ListNotes =()=> {

    return(
        <>
            {
                data.map(({id, title, content})=>{
                    return <Note id={id} title_={title} content={content}/>
                }
                )
            }
        </>
    );
}

export default ListNotes;
